import React from 'react';

const Register = () => {
  return (
    <div className="container">
      <div className="login-option">
        <text>Already have an account?</text>
        <text id="login-button" style={{ fontWeight: 'bold', color: 'blue' }}> Login</text>
      </div>
    </div>
  );
}

export default Register;
